public class MainFunctions {

public static int[] getPrerequisites(int value){
        ArrayList<Integer> obj = new ArrayList<Integer>();  
        Datasource ds=new Datasource(); 
            try{
                ds.connect();
                java.sql.Statement s=ds.createStatement();
                java.sql.Statement s1=ds.createStatement();     
                ResultSet rs = s.executeQuery("Select prerequisites_course_id from common_course_prerequisites where course_id="+value);            
                while(rs.next()){
                    int[] arr = ArrayUtils.toPrimitive(obj.toArray(new Integer[obj.size()]));
                    int a =rs.getInt(1);
                    boolean contains = IntStream.of(arr).anyMatch(x -> x == a);
                    if(contains==false){
                    obj.add(rs.getInt(1));
                        ResultSet rs1 = s1.executeQuery("Select prerequisites_course_id from common_course_prerequisites where course_id="+rs.getInt(1));
                        while(rs1.next()){ 
                            int[] arr1 = ArrayUtils.toPrimitive(obj.toArray(new Integer[obj.size()]));
                            int a1 =rs1.getInt(1);
                            boolean contains1 = IntStream.of(arr1).anyMatch(x -> x == a1);
                            if(contains1==false){
                                obj.add(rs1.getInt(1));
                            }
                        }
                    }
              }
                ds.dropConnection();
            } catch (Exception ex) {
                ex.printStackTrace();
            }           
        int[] arr1 = ArrayUtils.toPrimitive(obj.toArray(new Integer[obj.size()]));          
        return arr1;
    }
}
